import { AppBar, Toolbar } from '@mui/material';
import React from 'react';

const AdminNavBar = () => {
    return(

        <AppBar>
            <Toolbar>
                <p>View Users</p>
                <p>Create Submission Types</p>
                <p>Allocate Panel Members</p>
                <p>Create Marking Scheme</p>
                <p>Upload</p>
            </Toolbar>
        </AppBar>  
      )
}

export default AdminNavBar;
